//鑾峰彇鐪�
function getProvince(){
    var rmap = new Map();
    for(var i=0;i<areas.length;i++){
        rmap.set(areas[i].areaId+"",areas[i].areaName);
    }
    return rmap;
}
//鑾峰彇甯�
function getCity(province){
    var rmap = new Map();
    for(var i=0;i<areas.length;i++){
        if(areas[i].areaId==province){
            var citiesArray=areas[i].cities;
            for(var j=0;j<citiesArray.length;j++){
                rmap.set(citiesArray[j].areaId+"",citiesArray[j].areaName);
            }
            break;
        }
    }
    return rmap;
}
//鑾峰彇鍖�
function getCountry(province,city){
    var rmap = new Map();
    for(var i=0;i<areas.length;i++){
        if(areas[i].areaId==province){
            var citiesArray=areas[i].cities;
            for(var j=0;j<citiesArray.length;j++){
                if(citiesArray[j].areaId==city){
                    var countryArray = citiesArray[j].counties;
                    for(var k=0;k<countryArray.length;k++){
                        rmap.set(countryArray[k].areaId+"",countryArray[k].areaName);
                    }
                 break;   
                }
            }
            break;
        }
    }
    return rmap;
}
//鑾峰彇鍊�
function getval(id){
  var dataid = document.getElementById(id).getAttribute("list")
  var nodelist =document.getElementById(dataid).children;
  for(let node of nodelist){
	  if(node.value==document.getElementById(id).value){
		return node.getAttribute("data-id")
	}
  }
}